presentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"84716","type":"Paragraph"},{"attributes":{},"id":"77052","type":"DatetimeTickFormatter"},{"attributes":{"line_alpha":0.1,"line_color":"#cab2d6","line_width":2.8,"x":{"field":"x"},"y":{"field":"y"}},"id":"84657","type":"Line"},{"attributes":{"data":{"x":{"__ndarray__":"AADAPQoOd0IAAICjXA53QgAAQAmvDndCAAAAbwEPd0IAAMDUUw93QgAAgDqmD3dCAABAoPgPd0IAAAAGSxB3QgAAwGudEHdCAACA0e8Qd0IAAEA3QhF3QgAAAJ2UEXdCAADAAucRd0IAAIBoORJ3QgAAQM6LEndCAAAANN4Sd0IAAMCZMBN3QgAAgP+CE3dCAABAZdUTd0IAAADLJxR3QgAAwDB6FHdCAACAlswUd0IAAED8HhV3QgAAAGJxFXdCAADAx8MVd0IAAIAtFhZ3QgAAQJNoFndCAAAA+boWd0IAAMBeDRd3QgAAgMRfF3dCAABAKrIXd0IAAACQBBh3QgAAwPVWGHdCAACAW6kYd0IAAEDB+xh3QgAAACdOGXdCAADAjKAZd0IAAIDy8hl3QgAAQFhFGndCAAAAvpcad0IAAMAj6hp3QgAAgIk8G3dCAABA744bd0IAAABV4Rt3QgAAwLozHHdCAACAIIYcd0IAAECG2Bx3QgAAAOwqHXdCAADAUX0dd0IAAIC3zx13QgAAQB0iHndCAAAAg3Qed0IAAMDoxh53QgAAgE4ZH3dCAABAtGsfd0IAAAAavh93QgAAwH8QIHdCAACA5WIgd0I=","dtype":"float64","shape":[58]},"y":[9.0,10.0,11.0,12.0,12.0,15.0,14.0,14.0,19.0,23.0,24.0,26.0,30.0,36.0,35.0,39.0,37.0,45.0,51.0,52.0,56.0,60.0,61.0,66.0,74.0,81.0,87.0,90.0,99.0,111.0,126.0,136.0,143.0,149.0,156.0,167.0,174.0,179.0,189.0,194.0,209.0,219.0,227.0,236.0,246.0,257.0,269.0,281.0,294.0,307.0,322.0,337.0,353.0,370.0,388.0,406.0,426.0,447.0]},"selected":{"id":"85729"},"selection_policy":{"id":"85730"}},"id":"84655","type":"ColumnDataSource"},{"attributes":{"source":{"id":"84655"}},"id":"84659","type":"CDSView"},{"attributes"
